import React from 'react';
import MobileMenu from './components/MobileMenu';
import Cabecalho from './components/Cabecalho';
import Menu from './components/Menu';
import Slide from './components/Slide';
import Servico from './components/Servico';
import FrescoTopHot from './components/FrescoTopHot';
import Estatico from './components/Estatico';
import Especial from './components/Especial';
import Testemunho from './components/Testemunho';
import LatestNews from './components/LatestNews';
import SeasonSale from './components/SeasonSale';
import CategoriaArea from './components/CategoriaArea';
import Footer from './components/Footer';




function App() {

  return (
    <div className="App">

      <MobileMenu />

      <div id="page">
        <Cabecalho />
        <Menu />
        <Slide />
        <Servico />
        <FrescoTopHot />
        <Estatico /> 
        <Especial />    
        <Testemunho />        
      </div>

      <LatestNews />
      <SeasonSale />
      <CategoriaArea />
      <Footer />

      <a href="#" class="totop"> </a>


      <div id="myModal" class="modal fade">
        <div class="modal-dialog newsletter-popup">
          <div class="modal-content">
            <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button>
            <div class="modal-body">
              <h4 class="modal-title">NEWSLETTER SIGNUP</h4>
              <form id="newsletter-form" method="post" action="#">
                <div class="content-subscribe">
                  <div class="form-subscribe-header">
                    <label>Subscribe to be the first to know about Sales, Events, and Exclusive Offers!</label>
                  </div>
                  <div class="input-box">
                    <input type="text" class="input-text newsletter-subscribe" title="Sign up for our newsletter" name="email" placeholder="Enter your email address" />
                  </div>
                  <div class="actions">
                    <button class="button-subscribe" title="Subscribe" type="submit">Subscribe</button>
                  </div>
                </div>
              </form>
              <div class="subscribe-bottom">
                <input name="notshowpopup" id="notshowpopup" type="checkbox" />
                Don’t show this popup again </div>
            </div>
          </div>
        </div>
      </div>
    </div>

  );
}

export default App;
